REVERSE LOGISTICS SERVICE LEVEL AGREEMENT

This Reverse Logistics Service Level Agreement (the "Agreement") is entered into as of this 1st day of March, 2023 (the "Effective Date"), by and between Eva Isaksson, residing at 11 C. Jose Antonio Aliaga, Apt. 37, and Gnatz-Tschentscher Enterprises, a company organized and existing under the laws of the United Kingdom, with its head office located at 45 High Street, London, UK ("Gnatz-Tschentscher").

WHEREAS, Gnatz-Tschentscher desires to engage Isaksson to provide reverse logistics services, and Isaksson is willing to provide such services, subject to the terms and conditions set forth herein;

NOW, THEREFORE, in consideration of the mutual covenants and promises contained herein and for other good and valuable consideration, the receipt and sufficiency of which is hereby acknowledged, the parties agree as follows:

1. SERVICES

1.1 Reverse Logistics Services. Isaksson agrees to provide Gnatz-Tschentscher with reverse logistics services (the "Services") in accordance with the terms and conditions set forth herein.

1.2 Reverse Distribution Process. Isaksson shall be responsible for managing the return and reverse distribution of products, including but not limited to the following activities:

1.2.1 Collection of returned products from Gnatz-Tschentscher's customers;
1.2.2 Inspection and grading of returned products;
1.2.3 Data entry and tracking of returned products;
1.2.4 Repair or refurbishment of returned products, if applicable;
1.2.5 Redistribution or disposal of returned products, as directed by Gnatz-Tschentscher.

2. PERFORMANCE METRICS

2.1 Isaksson shall provide Gnatz-Tschentscher with weekly reports detailing the following performance metrics:

2.1.1 Average time to process a return;
2.1.2 Average time to inspect and grade a returned product;
2.1.3 Average time to repair or refurbish a returned product

