CLEARING ADDENDUM

1. INTERPRETATION

1.1 In this Addendum, the following definitions apply:

"Clearing House" means a central counterparty, clearing house or similar entity through which a Transaction is cleared;

"Cleared Transaction" means a Transaction that is cleared through a Clearing House;

"Defaulting Clearing Member" has the meaning given to it in the rules of the relevant Clearing House;

"Defaulting Party" means a Defaulting Clearing Member or a Party in default under a Transaction;

"Default Rules" means the rules of the relevant Clearing House relating to the termination, liquidation or acceleration of Cleared Transactions in the event of a default or insolvency of a Clearing Member;

"Early Termination Amount" has the meaning given to it in the Default Rules;

"Termination Event" has the meaning given to it in the Default Rules;

1.2 In this Addendum, unless the context otherwise requires:

(a) a reference to a statutory provision is a reference to that statutory provision as amended or re-enacted from time to time;

